cambiarPaginacion(operacion:any) {

  if(operacion=='plus'&&
    this.paginatormax<this.Ventas.length){
    this.paginatormin=this.paginatormin+11;
  
    this.paginatormax=this.paginatormax+11;
  
    this.counter++;
  }else{
    if(this.counter>1&&operacion=='minus'){
      this.paginatormin=this.paginatormin-11;
    
      this.paginatormax=this.paginatormax-11;
    
      this.counter--;
    }else{
      if(operacion=='inicio'){
        this.paginatormin=0;
    
        this.paginatormax=10;
      
        this.counter=1;
      }else{
        if(operacion=='final'){
          const lastPage = Math.ceil(this.Ventas.length / 11);
          this.counter = lastPage;
          this.paginatormax = this.Ventas.length;
          this.paginatormin = (lastPage-1) * 11;
        }
      }
    }
  
  }

  console.log(
    this.paginatormin," ",this.paginatormax," ",this.counter
  )
}

getVentasPaginadas(): any[] {
  return this.Ventas.slice(this.paginatormin, this.paginatormax + 1);
}

generarPDF(TicketId: any, Total:any) {
  this.crudService.ObtenerVentasTicket(TicketId).subscribe(
    respuesta => {
      this.ventasTicket = respuesta; // Suponemos que es un arreglo de productos
      console.log(this.ventasTicket);

      const doc = new jsPDF();

      // Tamao de la pgina
      const pageWidth = doc.internal.pageSize.getWidth();
      const pageHeight = doc.internal.pageSize.getHeight();

      // Imagen de fondo
      doc.addImage(this.base64Image, 'PNG', 0, 0, pageWidth, pageHeight);

      // Ttulo del comprobante
      doc.setFontSize(18);
      doc.setTextColor(0, 0, 0); // Color del texto: negro
      doc.text('Comprobante de venta', 30, 35);

      // Nombre del cliente
      doc.setFontSize(14); // Tamao ms pequeo para el subttulo
      doc.text(`Cliente: ${ this.cliente[0].nombreCliente}`, 30, 45);

      // Encabezado de tabla
      doc.setFontSize(12);
      doc.text('Productos vendidos:', 30, 60);

      // Dibujar encabezados
      let yPosition = 70; // Posicin inicial de la tabla
      doc.setFontSize(10);
      doc.text('Nombre del Producto', 30, yPosition);
      doc.text('Cantidad', 100, yPosition);
      doc.text('Total ($)', 150, yPosition);
      yPosition += 10;

      // Iterar sobre los productos y agregarlos al PDF
      this.ventasTicket.forEach((producto: any) => {
        doc.text(producto.NombreProducto, 30, yPosition);
        doc.text(producto.CantidadProducto.toString(), 100, yPosition, { align: 'right' });
        doc.text(producto.Total, 150, yPosition, { align: 'right' });
        yPosition += 10;

        // Verificar si se necesita agregar una nueva pgina
        if (yPosition > pageHeight - 20) {
          doc.addPage();
          yPosition = 20; // Reiniciar posicin para la nueva pgina
        }
      });

      doc.text(`Total: $${Total}`, 150, yPosition + 10, { align: 'right' });

      // Guardar el archivo
      doc.save(`Ticket_${TicketId}.pdf`);
    },
    error => {
      console.error('Error al obtener datos del ticket', error);
    }
  );
}


